  selector: 'app-listCafe',
  templateUrl: './listCafe.component.html'
})
export class ListCafe {
  ShowContent = false;
  @Output()
  ShowContentEvent = new EventEmitter<boolean>();

  @Input()
  Dishes!: IMenuCafe

}
